import logo from './logo.svg';
import './App.css';
import { Route } from 'react-router-dom';
import Home from './pages/Home';
import Cart from './pages/Cart';

function App() {
  return (
    <div className="App">
      <Route path='/'>
        <Home />
        <Cart></Cart>

      </Route>
    </div>
  );
}

export default App;
